import { SET_FORMDATA } from "../actions/actions-types";

const initialState = {
    formData: {}
}

export default function FormDataReducer(state = initialState, action) {
    switch(action.type) {
        case SET_FORMDATA:
            return {
                ...state,
                formData: {...formData, ...action.payload}
            }
        default:
            return state;
    }
}
